package ManishLokesh.Neptune.v1.GetOrderFromIRCTC.RequestBody;public class PriceDetails {    private Float deliveryCharge;    private Float discountAmount;    private Float totalAmount;    private Float totalMargin;    private Float gst;    private Float amountPayable;    public Float getDeliveryCharge() {        return deliveryCharge;    }    public void setDeliveryCharge(Float deliveryCharge) {        this.deliveryCharge = deliveryCharge;    }    public Float getDiscountAmount() {        return discountAmount;    }    public void setDiscountAmount(Float discountAmount) {        this.discountAmount = discountAmount;    }    public Float getTotalAmount() {        return totalAmount;    }    public void setTotalAmount(Float totalAmount) {        this.totalAmount = totalAmount;    }    public Float getTotalMargin() {        return totalMargin;    }    public void setTotalMargin(Float totalMargin) {        this.totalMargin = totalMargin;    }    public Float getGst() {        return gst;    }    public void setGst(Float gst) {        this.gst = gst;    }    public Float getAmountPayable() {        return amountPayable;    }    public void setAmountPayable(Float amountPayable) {        this.amountPayable = amountPayable;    }}